import React, {useRef, useEffect} from 'react';
import {HeroPage} from "./pages/HeroPage"
import {AboutMePage} from "./pages/AboutMePage";
import {HireMePage} from "./pages/HireMePage";
import {MyWorkPage} from "./pages/MyWorkPage";


function App() {

    useEffect(() => {
        const a = pages[0].btn;
    });

    const pages = [
        <HeroPage />,
        <AboutMePage />,
        <MyWorkPage />,
        <HireMePage />
    ]

  return (
      pages
    );
}

export default App;

